entity29492n.addComponent(new NFTdata(entity29492n, "0xbace7e22f06554339911a03b8e0ae28203da9598", "4276", "Tangerine Whistle", "Cryptoarte - Denial of Service", "The DoS attacks of Fall 2016 took a serious toll on the immediate network health of the Ethereum blockchain; with a large number of nodes not being able to sync, hard forks had to be quickly planned and implemented by client teams in order to restore operations. The first fork, named Tangerine Whistle, fixed several underpriced IO-heavy operations, as specified in EIP-150. This non-contentious fork occurred on October 18th 2016, approximately one month after the first DoS attack took place.", "", "More info")) 
